                                        <p class="mb0">In Lonato ist es am Morgen grau und es bleibt neblig bei Temperaturen von 3C. Am Mittag wird die Sonne von einzelnen Wolken verdeckt bei Hchstwerten von 11C. Abends ist es in Lonato vielfach wolkig bei Werten von 7 bis zu 8C. In der Nacht ist es berwiegend dicht bewlkt bei Tiefsttemperaturen von 6C.  Mit Ben zwischen 8 und 14 km/h ist zu rechnen.</p>
